import "./FilterButtons.css";

const Filter = ({ buttonText, button1, button2 }) => {
    return (
        <div>
            <button onClick={() => onFilterClick("filter1")}>Filter 1</button>
            <button onClick={() => onFilterClick("filter2")}>Filter 2</button>
        </div>
    );
};


export default Filter;
